import { BrowserRouter, Route, Routes } from "react-router-dom";
import PlanetsScreen from "./screens/planets";

//import Planet from "./components/planets/planet";

const Rotas = () =>(
    <BrowserRouter>
      <Routes>
        <Route path='' element={<PlanetsScreen />} />
      </Routes>
    </BrowserRouter>
  );

export default Rotas;
